          "description": "\u003cp\u003eBe careful with \u003ccode\u003e\u003ca\u003eLineTitle\u003c/a\u003e\u003c/code\u003e\nwhich can only be used as part of gnuplot's \u003ccode\u003eplot\u003c/code\u003e command\nbut not as part of \u003ccode\u003eset\u003c/code\u003e.\nThat is,\n\u003c/p\u003e\u003cpre\u003e plotList [LineStyle 0 [LineTitle \"foobar\"]] [0,5..100::Double]\n\u003c/pre\u003e\u003cp\u003ewill leave you with an invalid gnuplot script, whereas\n\u003c/p\u003e\u003cpre\u003e plotListStyle [] (defaultStyle {lineSpec = CustomStyle [LineTitle \"foobar\"]}) [0,5..100::Double]\n\u003c/pre\u003e\u003cp\u003edoes what you want.\n\u003c/p\u003e\u003cp\u003eThe \u003ccode\u003e\u003ca\u003eInt\u003c/a\u003e\u003c/code\u003e types would be better enumerations\nbut their interpretations depend on the gnuplot output type. :-(\n\u003c/p\u003e",
          "module": "Graphics.Gnuplot.Simple",
